css:
atom-ternjs-reference > div > div {
  max-height: 180px;
  overflow-y: auto;
}
atom-ternjs-rename > div {
  padding: 20px;
}
atom-ternjs-reference > div {
  position: relative;
}
atom-ternjs-reference > div > div {
  padding: 0 20px 20px;
}
atom-ternjs-reference ul {
  list-style: none;
  padding-left: 0;
}
atom-ternjs-reference li {
  cursor: pointer;
  padding: 6px 0;
}
atom-ternjs-reference li:hover {
  background: rgba(100, 100, 100, 0.3);
}
atom-ternjs-reference h3 {
  margin: 0;
}
atom-ternjs-reference h3 > span {
  display: block;
  float: left;
}
atom-ternjs-reference h3 > span:first-child {
  width: 70%;
}
atom-ternjs-reference h3 > span:nth-child(2) {
  width: 30%;
  text-align: right;
}
atom-ternjs-reference .clear {
  clear: left;
}
atom-ternjs-reference strong {
  color: #5293d8;
}
atom-ternjs-reference .darken {
  color: #777777;
}
.atom-ternjs-documentation,
.atom-ternjs-type {
  max-width: 1000px;
  background: #202123;
  color: #fff;
  border-radius: 2px;
}
.atom-ternjs-documentation h3,
.atom-ternjs-type h3,
.atom-ternjs-documentation p,
.atom-ternjs-type p,
.atom-ternjs-documentation a,
.atom-ternjs-type a {
  word-break: break-word;
}
.atom-ternjs-documentation {
  border: 10px solid rgba(0, 0, 0, 0.5);
}
.atom-ternjs-type {
  padding: 5px 20px;
  border: 1px solid rgba(0, 0, 0, 0.5);
}
atom-ternjs-type > div,
atom-ternjs-documentation > div {
  max-height: calc(33.33333333vh);
  overflow-y: auto;
}
atom-ternjs-documentation > div:not(:empty) {
  padding: 5px 20px;
}
atom-ternjs-type {
  color: #aaa;
}
atom-ternjs-type .doc-param-first,
atom-ternjs-type .storage.type {
  display: inline-block;
}
atom-ternjs-type .doc-param-first,
atom-ternjs-type .doc-return {
  margin-top: 10px;
}
atom-ternjs-type .current-param {
  font-weight: 500;
}
atom-text-editor[data-grammar="source js"] .atom-ternjs-definition-marker div {
  transition: opacity 0.75s ease;
  opacity: 0;
  background: #4182C4;
  border-bottom: 4px solid #ffaa2c;
}
atom-text-editor[data-grammar="source js"] .atom-ternjs-definition-marker.active div {
  opacity: 1;
}
.atom-ternjs-reference-close {
  margin: 20px;
  position: absolute;
  right: 0;
  top: 0;
}
.atom-ternjs-config .btn,
atom-ternjs-rename .btn {
  width: 100%;
  padding: 10px 0;
}
.atom-ternjs-config > div {
  max-height: 100%;
  padding: 20px;
  overflow: scroll;
}
.atom-ternjs-config h1 {
  margin-bottom: 50px;
  color: #5293d8;
}
.atom-ternjs-config h2 {
  width: 100%;
}
.atom-ternjs-config section {
  padding-bottom: 20px;
  border-top: 5px solid rgba(0, 0, 0, 0.5);
}
.atom-ternjs-config atom-text-editor {
  width: calc(100% - 60px);
}
.atom-ternjs-config .add,
.atom-ternjs-config .sub {
  cursor: pointer;
  position: absolute;
  top: 50%;
  transform: translateY(-50%);
}
.atom-ternjs-config .add {
  right: 0;
}
.atom-ternjs-config .sub {
  right: 30px;
}
.atom-ternjs-config .input-wrapper {
  position: relative;
}
.atom-ternjs-config .input-wrapper span {
  font-size: 12px;
}
.atom-ternjs-config .input-wrapper:first-of-type .sub {
  display: none;
}
.atom-ternjs-config .input-wrapper + .input-wrapper {
  margin-top: 10px;
}
.atom-ternjs-config .libs span,
.atom-ternjs-config .ecmaVersion span,
.atom-ternjs-config .plugins span {
  margin-right: 10px;
}
.atom-ternjs-config .libs .input-wrapper,
.atom-ternjs-config .ecmaVersion .input-wrapper {
  display: inline-block;
}
.atom-ternjs-config .libs .input-wrapper + .input-wrapper,
.atom-ternjs-config .ecmaVersion .input-wrapper + .input-wrapper {
  margin-left: 20px;
}
.atom-ternjs-config .plugins .input-wrapper {
  margin-bottom: 5px;
}
.atom-ternjs-config .input-wrapper:not(:last-of-type) .add {
  display: none;
}
